#Requires -Version 2

$Bookmaking = ""
$Execrating = ""
$Painfuller = ""
$Jitteriest = ""
$Downgrades = ""
$Uncleanest = ""
$Shuddering = ""
$Complacent = ""
$Wiesenthal = ""
$Hammerings = ""
$Injunction = ""
